goog.module("goog.collections.sets");const iterables=goog.require("goog.labs.collections.iterables");exports.intersection=function(e,t){return new Set(iterables.filter(t,t=>e.has(t)))},exports.union=function(e,t){const o=new Set(e);return iterables.forEach(t,e=>o.add(e)),o},exports.difference=function(e,t){const o=new Set(e);return iterables.forEach(t,e=>o.delete(e)),o},exports.symmetricDifference=function(e,t){const o=new Set(e);for(const n of t)e.has(n)?o.delete(n):o.add(n);return o};